import imagen from "./YoCaricatura.jpeg";

const Logo = (props) => {


        return <>
                <header>
                  <h1>BIENVENIDO A POKEDEX "(NO SON ES UN POKEMON)"</h1>
                  <img src={imagen} alt="Pokemon" onClick={props.handleClick}></img>

                  <p>{props.appName}</p>

                </header>
                </>

    }

  export default Logo;
